// 작성된 활동 목록을 보여주는 리스트

import React, {useState} from 'react';

export default function ActivityList({ activities =[], details=[] }) {
  if (activities.length === 0) {
    return <p>아직 추가된 활동이 없어요.</p>;
  }

  return (
    <ul className="activity-list">
      {activities.map((activity, details, index) => (
        <li key={index}>{activity.title}</li>
      ))}
    </ul>
  );
}
